import { LOGIN_SUCCESS, GET_ACCOUNTS_API, LOGOUT, GET_LOGIN_TOKEN, SET_AUTH } from '../Constants/Auth';

export const getLoginTokens = () => ({
  type: GET_LOGIN_TOKEN,
});

export const getAccounts = () => ({
  type: GET_ACCOUNTS_API,
});

export const setAuth = (value) => ({
  type: SET_AUTH,
  value,
});

export const setProfile = (value) => ({
  type: LOGIN_SUCCESS,
  value,
});

export const removeProfile = () => ({
  type: LOGOUT,
});
